import CONFIG from '../../server/config' 

export async function attemptLogin(username: string, password: string) {
    console.log("testing")
    const loginResponse = await CONFIG.AXIOSINSTANCE.post('/auth', {
        'username': username,
        'password': password
    })
    if (loginResponse.status === 200)
        return true
    else 
        return loginResponse.data.error 
}
